bool ok = false;

map<int, int> counter, memo1, memo2;

inline bool check(vector<int>& a, int n, int w) {
    vector<bool> dp(w / 2 + 1, false);
    vector<int>pr(w + 1, 0);
    vector<bool> used(n, false);
    dp[0] = true;
    for (int i = 0; i < n; i++) {
        for (int j = a[i]; j <= w / 2; j++) {
            if (dp[j - a[i]]) {
                pr[j] = j - a[i];
                dp[j] = true;
            }
        }
    }
    int pos = w / 2;
    if (!dp[w / 2]) {
        cout << -1;
        return false;
    }
    map<int, int> cnt;
    while (pos != 0) {
        cnt[pos - pr[pos]]++;
        if (cnt[pos - pr[pos]] > counter[pos - pr[pos]]) {
            return false;
        }
        pos = pr[pos];
    }
    for (int i = 0; i < n; i++) {
        if (cnt[a[i]]) {
            used[i] = true;
            cnt[a[i]]--;
        }
    }
    dp.assign(n, false);
    dp[0] = true;
    pr.assign(n, 0);
    for (int i = 0; i < n; i++) {
        if (used[i]) {
            continue;
        }
        for (int j = w / 2; j >= a[i]; j--) {
            if (dp[j - a[i]] && !dp[j]) {
                pr[j] = j - a[i];
                dp[j] = true;
            }
        }
    }
    cnt.clear();
    if (!dp[w / 2]) {
        return false;
    } else {
        pos = w / 2;
        while (pos != 0) {
            cnt[pos - pr[pos]]++;
            if (cnt[pos - pr[pos]] > counter[pos - pr[pos]]) {
                return false;
            }
            pos = pr[pos];
        }
        int sm = 0;
        for (auto& [el, num] : cnt)  {
            sm += el * num;
        }
        if (sm == w / 2) {
            for (int i = 0; i < n; i++) {
                if (used[i]) {
                    memo1[a[i]]++;
                }
            }
            for (auto& [el, num] : cnt) {
                memo2[el] = num;
            }
            if (len(memo1) != len(memo2)) {
                memo1.clear();
                memo2.clear();
                return false;
            }
            return true;
        }
    }
    return false;
}

inline void solve() {
    int n;
    cin >> n;
    vector<int> a(n);
    int w = 0;
    for (auto &i : a) {
        cin >> i;
        w += i;
        counter[i]++;
    }
    if (n % 2 || w % 2) {
        cout << -1;
        return;
    }
    vector<bool> dp(w / 2 + 1, false);
    vector<int>pr(w + 1, 0);
    vector<bool> used(n, false);
    dp[0] = true;
    for (int i = 0; i < n; i++) {
        for (int j = w / 2; j >= a[i]; j--) {
            if (dp[j - a[i]]) {
                pr[j] = j - a[i];
                dp[j] = true;
            }
        }
    }
    auto gen = a;
    for (int i = 0; i < 500; i++) {
        if (check(gen, n, w)) {
            ok = true;
            break;
        }
        random_shuffle(all(gen));
    }
    if (ok) {
        vector<bool> us(n, false);
        for (int i = 0; i < n; i++) {
            if (memo1[a[i]] && !us[i]) {
                cout << i + 1 << ' ';
                us[i] = true;
                memo1[a[i]]--;
            }
        }
        cout << '\n';
        for (int i = 0; i < n; i++) {
            if (memo2[a[i]] && !us[i]) {
                cout << i + 1 << ' ';
                us[i] = true;
                memo2[a[i]]--;
            }
        }
    } else {
        cout << -1;
    }
}

