                    }
                    mass = new array();
                    mass.createArray();
                break;
                case ("set array name"): mass.setName(); break;
                case ("set array size"): mass.setSize(); break;
                case ("set array"): mass.setElements(); break;
                case ("view array"): mass.displayArray(); break;
                default : if (!input.getAns().equals("exit"))
                            input.displayError();
                break;
            }
