/**
 * Criar objeto Jquery<HTMLElement> e aplica valores de dado objeto.
 * Os valores devem seguir padrão '{value}', indicados pela chave do objeto data.
 * Caso hajam valores aninhados, usar a marcação de ponto no padrão '{parent.child.grandchild}'.
 *
 * Esta função é uma simplificação do plugin MustacheJS.
 *
 * @param {String} templateId ID do template
 * @param {Object} data Valores que serão substiuidos no template
 * @returns {JQuery}
 */
function uxtpl(templateId, data) {
    function isNull(s) {
        return s === null
    }

    function isNullEmpty(s) {
        return s === '' || isNull(s)
    }

    /**
     * Obtém template.
     *
     * @param {String} templateId
     * @returns {String}
     * @throws {ReferenceErrorException}
     */
    function getSource(templateId) {
        const tpl = $(templateId)

        if (!tpl.length) {
            throw new ReferenceError(`Elemento '${templateId}' não existe no documento.`)
        }

        return tpl.html()
    }

    /**
     * Obtém lista de shortcodes
     *
     * @param {String} source
     * @returns {RegExpMatchArray}
     */
    function getShortcodes(source) {
        return source.match(/{(.*?)}/gi)
    }

    /**
     * Extrai propriedade do objeto-base.
     *
     * @param {Object} data
     * @param {String} prop
     * @return {String|Number|Array<String|Number>}
     */
    function pluck(data, prop) {
        if (data === undefined || isNull(data)) {
            return null
        }

        if (prop.includes(':')) {
            prop = prop.split(':')[0]
        }

        return data[prop]
    }

    /**
     * Aplica shortcodes ao template.
     *
     * @param {String} source
     * @param {String} shortcode
     * @param {Object} data
     * @returns {String}
     */
    function applyShortcodes(source, shortcodes, data) {
        return shortcodes.reduce((source, shortcode) => {
            let origin = shortcode.replaceAll(/(\{|\})/gi, '').split('.')
            let value = origin.reduce(pluck, data)

            if (Array.isArray(value)) {
                let childTpl = origin.pop().split(':')[1]
                let childSource = getSource(childTpl)
                let childShortcodes = getShortcodes(childSource)

                value = value.map(childData => applyShortcodes(childSource, childShortcodes, childData)).join('')
            }

            source = source.replaceAll(shortcode, isNullEmpty(value) ? '' : value)

            return source
        }, source)
    }

    let source = getSource(templateId)
    let shortcodes = getShortcodes(source)

    if (shortcodes) {
        source = applyShortcodes(source, shortcodes, data)
    }

    let $source = $(source)

    if (shortcodes && shortcodes.includes('{_self}')) {
        $source.attr('data-source', JSON.stringify(data))
    }

    return $source
}

