  digitalWrite(LED_BUILTIN, LOW);
}

void loop()
{
  digitalWrite(LED_ORANGE, HIGH);
  MyTim->setCount(0);
  MyTim->resume();
  const unsigned long startTime = MyTim->getCount();
  for (int i = 0; i < count; i++) {
    rtt.print(str);
    digitalToggle(LED_BUILTIN);
  }
  MyTim->pause();
  const unsigned long currentTime = MyTim->getCount();
  digitalWrite(LED_ORANGE, LOW);
  digitalWrite(LED_BUILTIN, LOW);
  const unsigned long t = currentTime - startTime;
  long speed = count * str.length() * 1000U / t;
  rtt.println();
  rtt.println("rtt speed test");
  rtt.print("speed: ");
  rtt.print(speed);
  rtt.println(" chars/s");
  delay(5000);
}
